import React from "react";
import Planeteer from "./Planeteer";

function PlaneteersContainer(planteerData) {
  const planeteers = planteerData.map((planrteer) => {
    return(
      <Planteer
      image={planteer.image}
      name={planteer.name}
      bio={planteer.bio}
      twitter={planteer.twitter}
      />
    )
  }) 

  return (
    <ul className="cards">
      {planteers}
    </ul>
  );
}

export default PlaneteersContainer;
